struct Bitmap {
  Bitmap(const int& width, const int& height)
      : data(),
        width(width),
        height(height) {
    data.resize(width * height);
  }

  std::vector<unsigned char> data;
  int width;
  int height;

  inline unsigned char* getPointer() const {
    if (data.empty()) {
      return nullptr;
    }

    return const_cast<unsigned char*>(data.data());
  }
};

using Bitmap_t = std::shared_ptr<Bitmap>;

class TrueTypeFontRegistry {
 private:
  inline static const unsigned long ASCII_MAX_NUM_CHARS = 128;

  FT_Library _library;
  FT_Face _face;
  int _padding;

 private:
  static void drawBitmap(const FT_Bitmap& srcBitmap,
                         const int& cursorX,
                         const int& cursorY,
                         Bitmap_t& distBitmap);

 public:
  TrueTypeFontRegistry(const unsigned int* ttfFontData,
                       const unsigned int ttfFontDataSize,
                       const unsigned int pixelSize = 64,
                       const unsigned int padding = 16);
  ~TrueTypeFontRegistry();

  Bitmap_t getBitmap(const char* text, int& width, int& height) const;
};

